import {Link} from 'react-router-dom';
import GetWordContainer from './pages/GetWordContainer';
import Definitions from './pages/DefinitionsContainer';

 const App = () => {
  return (
    <>
      <header>
        <nav>
          <Link to='/'>Saved</Link>
        </nav>
      </header>

      <main>
        <h1>My Dictionary</h1>
        <GetWordContainer />
        <Definitions/>
      </main>
    </>
  );
}

export default App;
